import React from 'react';
import Navbar from './Navbar';
import Home from './Home';
import Services from './Services';
import Contact from './Contact';
import Footer from './Footer';
const MainFrame = () => {
  return (
    <>
      <Navbar/>
      <Home/>
      <Services/>
      <div id='con'>
      <Contact/>
      </div>
      <Footer/>
    </>
  );
}

export default MainFrame;
